import { Link } from "react-router-dom";

export default function Header(){

  
    return(
        <header>
        <Link to="/" class="logo">Blog App</Link>
        <nav>
          <Link to="/login" class="login">Login</Link>
          <Link to="/register" class="register">Register</Link>
        </nav>
      </header>
    );
}
